// src/components/Contact.js
import React from 'react';
import { motion } from 'framer-motion';
import { Heart, Users, Phone, Home, Sparkles } from 'lucide-react';

const Contact = () => {
  const contactVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.3
      }
    }
  };

  const itemVariants = {
    hidden: { y: 40, opacity: 0, scale: 0.9 },
    visible: {
      y: 0,
      opacity: 1,
      scale: 1,
      transition: {
        duration: 0.8,
        ease: "easeOut"
      }
    }
  };

  const floatVariants = {
    float: {
      y: [0, -15, 0],
      transition: {
        duration: 4,
        repeat: Infinity,
        ease: "easeInOut"
      }
    }
  };

  return (
    <section className="section-padding bg-gradient-to-br from-burgundy to-dark-burgundy relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute inset-0 overflow-hidden">
        <motion.div
          variants={floatVariants}
          animate="float"
          className="absolute top-20 left-20 text-gold/10"
        >
          <Heart className="w-16 h-16" />
        </motion.div>
        <motion.div
          variants={floatVariants}
          animate="float"
          transition={{ delay: 2 }}
          className="absolute bottom-20 right-20 text-gold/10"
        >
          <Users className="w-20 h-20" />
        </motion.div>
        <motion.div
          variants={floatVariants}
          animate="float"
          transition={{ delay: 1 }}
          className="absolute top-1/2 left-1/4 text-gold/5"
        >
          <Home className="w-24 h-24" />
        </motion.div>

        {/* Gold sparkle effects */}
        <motion.div
          animate={{ rotate: 360 }}
          transition={{ duration: 20, repeat: Infinity, ease: "linear" }}
          className="absolute top-1/4 right-1/4 text-gold/20"
        >
          <Sparkles className="w-12 h-12" />
        </motion.div>
      </div>

      {/* Animated Background Pattern */}
      <div className="absolute inset-0 opacity-5">
        <div className="absolute inset-0 bg-[radial-gradient(circle_at_1px_1px,white_1px,transparent_0)] bg-[length:40px_40px]"></div>
      </div>

      <motion.div
        variants={contactVariants}
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, margin: "-50px" }}
        className="max-w-6xl mx-auto relative z-10"
      >
        {/* Header Section */}
        <motion.div variants={itemVariants} className="text-center mb-16">
          <motion.div
            initial={{ scale: 0 }}
            whileInView={{ scale: 1 }}
            transition={{ 
